import { useEffect, useState } from 'react'
import io from 'socket.io-client'
import TreeChannel from './components/TreeChannel/TreeChannel'

const socket = io('http://10.147.18.205:3001')

const Admin = () => {
	const [AllChats, setAllChats] = useState(null)

	useEffect(() => {
		const fetchData = async () => {
			try {
				socket.emit('GetAllChannelFromServer', results => {
					if (results !== null)
						results.categorys = new Map(JSON.parse(results.categorys))
					setAllChats(results)
				})
			} catch (error) {
				console.log('Error fetching data:', error)
			}
		}

		fetchData()
		return () => {
			socket.off('updatePlaylist')
		}
	}, [])


	return (
		<div>
		<div class="container mt-4">
  <ul class="vertical-menu">
    <li>
      <a href="#">Пункт 1</a>
      <div class="horizontal-dropdown">
        <a href="#">Подпункт 1.1</a>
        <a href="#">Подпункт 1.2</a>
        <a href="#">Подпункт 1.3</a>
      </div>
    </li>
    <li>
      <a href="#">Пункт 2</a>
      <div class="horizontal-dropdown">
        <a href="#">Подпункт 2.1</a>
        <a href="#">Подпункт 2.2</a>
        <a href="#">Подпункт 2.3</a>
      </div>
    </li>
    <li>
      <a href="#">Пункт 3</a>
      <div class="horizontal-dropdown">
        <a href="#">Подпункт 3.1</a>
        <a href="#">Подпункт 3.2</a>
        <a href="#">Подпункт 3.3</a>
      </div>
    </li>
  </ul>
</div>
			<p>AllChats</p>
			<TreeChannel nodeChats={AllChats} />
		</div>
	)
}

export default Admin
